package com.donalola.util;

import org.apache.commons.io.FileUtils;
import org.junit.Test;

import java.io.File;

public class ImageUtilTest {

    private static final String ORIGINAL_BASE64 = "data:image/jpeg;base64,";

    @Test
    public void resizeImage() {
        File imageFile = ImageUtil.decodeFromBase64(ORIGINAL_BASE64);
        System.out.println(FileUtils.sizeOf(imageFile));
        File resizedImage = ImageUtil.resizeImage(imageFile, 100, 100);
        System.out.println(FileUtils.sizeOf(resizedImage));
        String base64Encoded = ImageUtil.encodeToBase64(resizedImage);
        System.out.println(base64Encoded);
    }

}